import React from "react"

import projectData from "../portfolio_data/projectData"
import Project from "./Project"

function MainContentPortfolio(){
    const myProjects = getProjectData();

    return (
        {myProjects}
        // <Project />
    )
}

function getProjectData(){
    let myProjects = new Array(projectData.length);
    for(let i = 0; i < projectData.length; i++){
        myProjects[i] = (<Project id={projectData[i].id} project={projectData[i].text}/>)
    }
    
    return myProjects;
}

export default MainContentPortfolio
